// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract Voting {
    address public admin;
    bool public votingStarted;
    bool public votingEnded;

    struct Voter {
        bool isRegistered;
        bool hasVoted;
        uint vote;
    }

    struct Candidate {
        uint id;
        string name;
        uint voteCount;
    }

    mapping(address => Voter) public voters;
    Candidate[] public candidates;

    event VoterRegistered(address voter);
    event VoteStarted();
    event VoteEnded();
    event Voted(address voter, uint candidateId);

    modifier onlyAdmin() {
        require(msg.sender == admin, "Only admin can call this function");
        _;
    }

    modifier onlyDuringVoting() {
        require(votingStarted && !votingEnded, "Voting is not active");
        _;
    }

    constructor(string[] memory candidateNames) {
        admin = msg.sender;
        for (uint i = 0; i < candidateNames.length; i++) {
            candidates.push(Candidate({
                id: i,
                name: candidateNames[i],
                voteCount: 0
            }));
        }
    }

    function registerVoter(address voterAddress) public onlyAdmin {
        require(!voters[voterAddress].isRegistered, "Voter is already registered");
        voters[voterAddress] = Voter({
            isRegistered: true,
            hasVoted: false,
            vote: 0
        });
        emit VoterRegistered(voterAddress);
    }

    function startVote() public onlyAdmin {
        require(!votingStarted, "Voting has already started");
        votingStarted = true;
        emit VoteStarted();
    }

    function endVote() public onlyAdmin {
        require(votingStarted, "Voting has not started yet");
        require(!votingEnded, "Voting has already ended");
        votingEnded = true;
        emit VoteEnded();
    }

    function vote(uint candidateId) public onlyDuringVoting {
        require(voters[msg.sender].isRegistered, "You are not registered to vote");
        require(!voters[msg.sender].hasVoted, "You have already voted");
        require(candidateId < candidates.length, "Invalid candidate ID");

        voters[msg.sender].hasVoted = true;
        voters[msg.sender].vote = candidateId;
        candidates[candidateId].voteCount += 1;

        emit Voted(msg.sender, candidateId);
    }

    function getResults() public view returns (Candidate[] memory) {
        require(votingEnded, "Voting has not ended yet");
        return candidates;
    }
}
